import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';
import { FaSearch } from 'react-icons/fa'; // Ensure react-icons is installed

// Example static data
const teamsData = [
  { name: "Team Alpha", description: "A team of experienced developers." },
  { name: "Team Beta", description: "A team of creative designers and developers." },
  { name: "Team Gamma", description: "A team working on AI-based projects." },
];

const membersData = [
  { name: "John Doe", skills: "JavaScript, React, Node.js" },
  { name: "Jane Smith", skills: "Python, AI, Machine Learning" },
  { name: "Sam Wilson", skills: "UI/UX Design, HTML, CSS" },
];

const ProfilePage = () => {
  const navigate = useNavigate();
  const [activeSection, setActiveSection] = useState(null);
  const [searchTerm, setSearchTerm] = useState("");

  const handleSearch = (e) => setSearchTerm(e.target.value);

  const filteredTeams = teamsData.filter(team =>
    team.name.toLowerCase().includes(searchTerm.toLowerCase())
  );
  const filteredMembers = membersData.filter(member =>
    member.name.toLowerCase().includes(searchTerm.toLowerCase())
  );

  // Styles
  const navBarStyle = { /* Navigation bar styles */ };
  const navItemStyle = { /* Navigation item styles */ };
  const searchBarStyle = { /* Search bar styles */ };
  const searchIconStyle = { /* Search icon styles */ };
  const sectionStyle = { /* Section styles */ };
  const scrollableBoxStyle = { /* Scrollable box styles */ };

  return (
    <div>
      {/* Navigation Bar */}
      <nav style={navBarStyle}>
        <div>SkillHunt</div>
        <div>
          <button style={navItemStyle} onClick={() => navigate("/")}>Home</button>
          <button style={navItemStyle} onClick={() => navigate("/teams")}>Teams</button>
          <button style={navItemStyle} onClick={() => navigate("/about")}>About</button>
        </div>
      </nav>

      {/* Teams Section */}
      {activeSection === "teams" && (
        <div style={sectionStyle}>
          <div>
            <input
              type="text"
              placeholder="Search teams..."
              value={searchTerm}
              onChange={handleSearch}
              style={searchBarStyle}
            />
            <FaSearch style={searchIconStyle} />
          </div>
          <div style={scrollableBoxStyle}>
            {filteredTeams.map((team, index) => (
              <div key={index}>{team.name}</div>
            ))}
          </div>
        </div>
      )}

      {/* Members Section */}
      {activeSection === "members" && (
        <div style={sectionStyle}>
          <div>
            <input
              type="text"
              placeholder="Search members..."
              value={searchTerm}
              onChange={handleSearch}
              style={searchBarStyle}
            />
            <FaSearch style={searchIconStyle} />
          </div>
          <div style={scrollableBoxStyle}>
            {filteredMembers.map((member, index) => (
              <div key={index}>{member.name}</div>
            ))}
          </div>
        </div>
      )}
    </div>
  );
};

export default ProfilePage;
